import React from "react";
import articles from "../blog/article-content";
import { Link } from "react-router-dom";

function Blog() {
  return (
    <div>
      <h2>Blog</h2>
      <ul>
        {articles.map((article, index) => (
          <li key={index}>
            <h3>{article.title}</h3>
            <p>{article.content[0]}</p>
            <Link to={`/blog/${article.name}`}>Read More</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Blog;
